gSy(){return"Codex Sinaiticus is written on vellum parchment, primarily made from calfskin, with some portions made from sheepskin. Originally, it was produced on double sheets, likely measuring approximately 40 \xd7 70 cm. The portion held in the British Library consists of 346\xbd folios (694 pages), each measuring about 38.1 \xd7 34.5 cm."},
gSz(){return"The manuscript is written in a formal uncial script (biblical majuscule) in Greek, featuring scriptio continua (continuous script without spaces between words). The text is arranged in columns: four columns per page in the New Testament and two per page for poetic texts. It also includes carefully regulated line breaks, nomina sacra, and distinctive punctuation."},
gSx(){return"Codex Sinaiticus was discovered in 1844 at Saint Catherine\u2019s Monastery on the Sinai Peninsula by Constantin von Tischendorf."},
gSt(){return"From a textological perspective, Codex Sinaiticus belongs to the Alexandrian text-type and is classified as Category I among New Testament manuscripts."},
gSv(){return"Today, parts of the codex are preserved in several institutions: primarily in the British Library (London), as well as in the Leipzig University Library, Saint Catherine\u2019s Monastery (Sinai), and the National Library of Russia (Saint Petersburg)."},
