gTP(){return"\u0423\u043d\u0446\u0456\u0430\u043b \u043d\u0430\u043f\u0438\u0441\u0430\u043d\u0438\u0439 \u043d\u0430 \u043f\u0435\u0440\u0433\u0430\u043c\u0435\u043d\u0442\u0456 (vellum). \u0412\u0456\u043d \u0441\u043a\u043b\u0430\u0434\u0430\u0454\u0442\u044c\u0441\u044f \u0437 92 \u0444\u043e\u043b\u0456\u043e, \u043a\u043e\u0436\u043d\u0435 \u0437 \u044f\u043a\u0438\u0445 \u043c\u0430\u0454 \u0440\u043e\u0437\u043c\u0456\u0440 \u043f\u0440\u0438\u0431\u043b\u0438\u0437\u043d\u043e 23 \xd7 18 \u0441\u043c. \u0420\u0443\u043a\u043e\u043f\u0438\u0441 \u043c\u0456\u0441\u0442\u0438\u0442\u044c \u043d\u0435\u043f\u043e\u0432\u043d\u0438\u0439 \u0442\u0435\u043a\u0441\u0442 \u041e\u0431'\u044f\u0432\u043b\u0435\u043d\u043d\u044f \u0440\u0430\u0437\u043e\u043c \u0437 \u043a\u043e\u043c\u0435\u043d\u0442\u0430\u0440\u0435\u043c \u0410\u043d\u0434\u0440\u0456\u044f \u041a\u0435\u0441\u0430\u0440\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e."},
